import React from "react";
import Home from "./Home";
import "./main.css"
import videobg from '../components/video.mp4'
function Main()
{
    return (
 <div className="main">
   <div className="overlay"></div>
    <video src={videobg}  autoPlay loop muted />
   <div className="content">
   <Home/>
    </div>
 </div>
    )
}
export default Main ;
